window.bookSummaryJSON = "<p><i>Rebecca's Lost Journals</i> - The four novellas combined into one volume… </p> <p>Rebecca Mason has known heartache and sorrow in her life, losing everyone she loves. She's on her own in San Francisco, lost in every way, until she dares to make the decision to chase her dream of working in the art world. It is then that she meets a rich, seductively powerful man who will become the Master she never knew she wanted and change her life forever. He will lead her on a dark, passionate journey where pain is pleasure and pleasure is pain, and where every limit she once had is no more. In this man, she will find solace to her pain, an escape from the ache inside her. And in him, she will discover a darkness she may never escape. </p>"; 
